import React from 'react'

export class MainContainer extends React.Component{

    constructor(props){
        super(props);
    }

    handleClick(){
        document.getElementById('reg').classList.toggle('activeState');
        document.getElementById('log').classList.toggle('activeState');
    }

    render(){
        return <div className="mainContainer">
            <div className="header">
                <button className="navBtn activeState" id="log" on>{this.props.name}</button>
                <button className="navBtn" id="reg">Register</button>
            </div>
            <div id="core">

            </div>
        </div>
    }
}
